import React from 'react'
import DeleteForeverIcon from '@mui/icons-material/DeleteForever';
import EditIcon from '@mui/icons-material/Edit';

export default function ToDolist(props) {
    return (
        <>
            <li style={{display : 'flex', justifyContent : 'space-around', border : '2px solid black', backgroundColor : 'whitesmoke', margin : '10px', borderRadius : '1rem', alignItems : 'center'}}>
                {props.itemLists}
            <EditIcon onClick={()=>{
                props.edit(props.id)
            }} />
            <DeleteForeverIcon onClick={()=>{
                props.remove(props.id)}}
             className="fas fa-times-circle"></DeleteForeverIcon> </li>
        </>
    )
}
